import Liveclock from "./Liveclock";


export default function Dashboard() {
    const DashboardCards = [
        { title: "Current in house", src: Dashboardimg, component: "Dashboard",},
        { title: "Expected Arrivals", src: Reservationimg, component: "Reservations",},
        { title: "", src: Roomimg, gap: true, component: "Rooms" },
        { title: "Rental Receipt", src: Receiptimg, component: "RentalReceipt" },
      ];
    return (
        <div className="">
            <Liveclock/>
            <div>Current in house</div>
            <div>Expected Arrivals</div>
            <div>Expected Departures</div>
            <div>Expected Departures</div>

        </div>


    )
}
